import styles from './Table.module.scss'
const Table = (props) => {

  return (
    <div>
      <li className="d-flex justify-space-between">
        <h2 className="col-6">Table {props.id} </h2>
        <p className="col-6"><span className={styles.status}>Status:</span> {props.status} </p>
      </li>
      <button className="btn m=0">Show more</button>
    </div>
  )
}

export default Table;
